import React from 'react';
import ReactDOM from 'react-dom';
import { isCompositeComponentWithType } from 'react-dom/test-utils';
import "./index.css"

const img1 = "https://picsum.photos/100/100";
const img2 = "https://picsum.photos/100/100";
const img3 = "https://picsum.photos/100/100";
const link = "https://www.facebook.com";

const greeting={
  backgroundColor:'green',
  height:'100vh',
  width:'100%',
  display:'grid',
  alignItems:'center',
  justifyContent:'center'
}
const heading={
  backgroundColor:'white',
  borderRadius:50
}

ReactDOM.render(
  <>
    <div style={greeting}>
      <h1 style={heading}>Hello friend</h1>
    </div>
  </>
  ,
  document.getElementById("root"));
